import React, { Component } from 'react';
import Button from '../components/button/Button';
import '../Globals.css';
import './Home.css';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <h1>Bot-O-Mat</h1>

        <div className="contentContainer">
          <Button text="Add Robot"/>

          <div className="robotListContainer">

          </div>  

        </div>
      </div>
    );
  }
}

export default Home;
